tables.table_schema:
CREATE TABLE QuantumNodes (
    node_id INT PRIMARY KEY,
    node_name VARCHAR(255),
    location VARCHAR(255),
    quantum_capacity INT
);

CREATE TABLE Quantum_Network_Resources (
    resource_id INT,
    resource_name VARCHAR(255),
    network_location VARCHAR(255)
);

CREATE TABLE Quantum_Users (
    user_id INT,
    user_name VARCHAR(255),
    user_email VARCHAR(255),
    user_role VARCHAR(50)
);

CREATE TABLE Quantum_Resources (
    resource_id INT PRIMARY KEY,
    resource_name VARCHAR(255) NOT NULL,
    network_id INT NOT NULL,
    usage_status VARCHAR(50) DEFAULT 'Active'
);

CREATE TABLE Quantum_Networks (
    network_id INT PRIMARY KEY,
    network_name VARCHAR(255) NOT NULL,
    administrator_id INT NOT NULL
);

CREATE TABLE Quantum_Users (
    user_id INT PRIMARY KEY,
    user_name VARCHAR(255) NOT NULL,
    email_address VARCHAR(255) UNIQUE
);

CREATE TABLE quantum_resources (
    resource_id UUID PRIMARY KEY,
    resource_name VARCHAR(255) NOT NULL,
    network_location VARCHAR(100) NOT NULL,
    is_available BOOLEAN
);

CREATE TABLE quantum_users (
    user_id UUID PRIMARY KEY,
    user_name VARCHAR(255) NOT NULL,
    email VARCHAR(255) UNIQUE,
    created_at TIMESTAMP
);

CREATE TABLE quantum_networks (
    network_id UUID PRIMARY KEY,
    network_name VARCHAR(255) NOT NULL,
    connection_type VARCHAR(50),
    network_admin UUID
);

CREATE TABLE quantum_logs (
    log_id UUID PRIMARY KEY,
    log_description TEXT,
    log_timestamp TIMESTAMP,
    user_id UUID REFERENCES quantum_users(user_id)
);
